INSERT INTO `goods_goods` VALUES ('226', '', '《国酒酱香》茅台（MOUTAI）贵州茅台酒飞天茅台酒53度500ml 新飞天茅台 6瓶不是整箱', '0', '122', '0', '609', '1758', '1599.78', ' <p> <img onload=\"if(this.width&gt;750){this.height=this.height*(750.0/this.width); this.width = 750;}\" src=\"https://image.suning.cn/uimg/sop/commodity/207125123038461423512080_x.png\" alt=\"\"/></p> <p><strong>  <span style=\"font-size: 18px;\">                                                     <span style=\"color: #ff0000; font-size: 24px;\"> 特别约定：</span></span></strong></p> <p><span style=\"font-size: 18px;\"><strong> </strong></span></p> <div><span style=\"font-size: 18px;\"><strong><span data-spm-anchor-id=\"a220o.1000855.0.i1.286c256etqwkXZ\">   <span style=\"color: #ff0000;\"> 为更好地保障消费者的购酒需求，特此约定：</span><br/><span style=\"color: #ff0000;\">    1、同一客户，请按页面显示的可购买数量下单购买；限购4瓶 限购一单！拍多无法发货！</span><br/><span style=\"color: #ff0000;\">    2、下列订单视为同一客户购买，超过页面显示可购买数量的订单部分无效：</span><br/><span style=\"color: #ff0000;\">    （1）同一ID所下多笔订单的；</span><br/><span style=\"color: #ff0000;\">    （2）不同ID所下的订单，但收货地址、联系号码、收件人（巧合同名除外）、付款的支付宝或银行卡账户相同的，均视为同一客户。</span><br/><span style=\"color: #ff0000;\">     3、客户订单确认后，不得再联系后台客服或通过其他手段修改收货地址、联系电话等，否则订单作废</span><span style=\"color: #ff0000;\">。</span></span></strong></span></div> <div><span style=\"font-size: 18px;\"><strong><span data-spm-anchor-id=\"a220o.1000855.0.i1.286c256etqwkXZ\"><span style=\"color: #ff0000;\">     4、因为是贵重物品，必须是客户必须是本人收件，如果不是签收以后有任何问题不退不换，谢谢理解！</span></span></strong></span></div> <div><span style=\"font-size: 18px;\"><strong><span data-spm-anchor-id=\"a220o.1000855.0.i1.286c256etqwkXZ\"><span style=\"color: #ff0000;\">     5、本公司销售产品限制开票，如需开票需要联系在线客服！具体联系在线客服，介意勿下单！全部都是30天之内发货，国家节假日往后延迟！并且发货出库会把产品瓶身的物流码去掉，为了防止串货，影响本公司，介意请勿下单，谢谢配合！</span></span></strong></span></div> <div><span style=\"color: #ff0000;\"><span style=\"color: #ff0000;\"><span style=\"font-size: 18px;\"><strong>                           <span style=\"color: #ff0000;\">  </span></strong><span style=\"color: #ff0000;\">    <strong>                     </strong></span></span></span><span style=\"font-size: 14px;\"><strong>温馨提示：</strong></span></span> <p><strong><span style=\"color: #ff0000;\">                           <span style=\"font-size: 18px;\">如在运输当中出现轻微渗漏，约在（10ml）以下属于正常，概不退换，产品有很多不是全新产品，大多数是二次回收，二次销售，所以包装有不必要的磨损，但是不影响饮用，介意慎拍     </span></span></strong></p> <p><strong><span style=\"font-size: 18px; color: #ff0000;\">                               本产品限制开发票，如需开发票请联系客服了解</span></strong></p> <p><strong><span style=\"color: #ff0000;\">                                    <span style=\"font-size: 18px;\">因本公司签订供货协议为降低串货风险，非终端消费者一概不发货。</span></span></strong></p> </div> <p><span style=\"font-size: 18px;\"><strong><span style=\"color: #ff0000;\">                   如有非终端消费者订单烦请自行取消，下单视为同意我司规定</span></strong></span></p> <div moduleid=\"R7403001_2\" modulename=\"&#x5546;&#x54C1;&#x4FE1;&#x606F;\"><div id=\"kernelParmeter\" class=\"pro-detail-parameter\"> <ul class=\"cnt clearfix\"> <li title=\"53\">酒精度：53</li> <li title=\"酱香型\">白酒香型：酱香型</li> </ul> </div> <div id=\"productDetail\" class=\"pro-detail-pics\"> <p><img onload=\"if(this.width&gt;750){this.height=this.height*(750.0/this.width); this.width = 750;}\" class=\"err-product\" style=\"border: 0px; word-break: break-all; vertical-align: middle; background: url(\'images/blankbg.gif?v=2015102601\') 50% 50% no-repeat;\" src2=\"//image.suning.cn/uimg/sop/commodity/726237936201687644882990_x.jpg\" alt=\"\" width=\"750\" height=\"657\" src=\"http://res.suning.cn/public/v3/images/blank.gif\"/><img onload=\"if(this.width&gt;750){this.height=this.height*(750.0/this.width); this.width = 750;}\" class=\"err-product\" style=\"border: 0px; word-break: break-all; vertical-align: middle; background: url(\'images/blankbg.gif?v=2015102601\') 50% 50% no-repeat;\" src2=\"//image.suning.cn/uimg/sop/commodity/112867357389030096599670_x.jpg\" alt=\"\" width=\"750\" height=\"857\" src=\"http://res.suning.cn/public/v3/images/blank.gif\"/><img onload=